import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import "./index.css";
import Sdata from "./Sdata";
console.log(Sdata[0]);

// "props (which stands for propertties). react props are like function arguments in javascript."

ReactDOM.render(
  <>

    <h1 className = "heading_style"> List Of Top 5 Amazon Prime  Series</h1>  

  <Card
      imgsrc= {Sdata[0].imgsrc}
      title= {Sdata[0].title}
      sname = {Sdata[0].sname}
      link=   {Sdata[0].links}

    />
    <Card
       imgsrc="https://wallpapercave.com/wp/wp4507678.jpg"
      title = "Amazon Prime Original Series"
      sname = "Mr. Robot"
      link = "https://www.primevideo.com/detail/0LL805LRLJUMK1H89CP0LFLBL5/ref=atv_tv_hom_c_1KkZSf_2_1"

    />
    <Card
       imgsrc="https://wallpapercave.com/wp/wp4507678.jpg"
      title = "Amazon Prime Original Series"
      sname = "Mr. Robot"
      link = "https://www.primevideo.com/detail/0LL805LRLJUMK1H89CP0LFLBL5/ref=atv_tv_hom_c_1KkZSf_2_1"

    />
  </>,
  document.getElementById('root')
);

